import React from "react";
import{
    RecommendWrapper,
    RecommendItem
} from "../home_style";

class Recommend extends React.Component{
    render(){
        return (
            <RecommendWrapper>
                <RecommendItem imgUrl="https://cdn2.jianshuts/web/banner-s-club-aa8bdf19f8cf729a759da42e4a96f366.png"></RecommendItem>
            </RecommendWrapper>
        )
    }
}
export default Recommend;
